import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './Home'

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/">
            <SignUp />
        </Route>

        {/* Gotta keep this one on the bottom */}
        <Route path="/">
            <Home />
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
